import re
from collections import deque

def get_input():
    with open('input', 'r') as file:
        contents = file.read().strip().split('\n')
    return contents

def main():
    contents = ''
    for i in range(13, len(contents)):
        slice = contents[i-13:i+1]
        if len(slice) == len(set(slice)):
            print(i+1)
            break

if __name__ == '__main__':
    main()
